import React, { useState, useEffect } from "react";
import "./styles/newTrade.css";
// import { showSuccessModal, showUnsuccessModal } from "./components/Utility";

const NewTrade = ({}) => {
  const [showModal, setShowModal] = useState(false);
  const [formData, setFormData] = useState({
    symbol: "",
    option_type: "",
    strike_price: "",
    expiration_date: "",
    entry_price: "",
    exit_price: "",
    contracts: "",
    open_date: "",
    close_date: "",
    profit_loss: "",
  });

  useEffect(() => {
    // Any initialization code here
  }, []);

  const toggleModal = () => {
    setShowModal(!showModal);
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };
  const fetchTrades = () => {
    fetch("http://localhost:8000/trades/")
      .then((response) => response.json())
      .then((data) => {
        setRecentTrades(data); // Update state with fetched data
      })
      .catch((error) => {
        console.error("Error fetching recent trades:", error);
      });
  };
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Convert empty strings to null for optional fields
      const payload = {
        ...formData,
        exit_price: formData.exit_price === "" ? null : formData.exit_price,
        close_date: formData.close_date === "" ? null : formData.close_date,
        profit_loss: formData.profit_loss === "" ? null : formData.profit_loss,
      };

      console.log("Submitting payload:", payload);

      // Make API request to add the new trade
      const response = await fetch("http://localhost:8000/trades/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(payload),
      });

      if (!response.ok) {
        throw new Error("Failed to add trade");
      }

      // Reset the form data
      setFormData({
        symbol: "",
        option_type: "",
        strike_price: "",
        expiration_date: "",
        entry_price: "",
        exit_price: "",
        contracts: "",
        open_date: "",
        close_date: "",
        profit_loss: "",
      });

      // Close the modal after successful submission
      setShowModal(false);
      fetchTrades();
      // showSuccessModal();
    } catch (error) {
      console.error("Error adding trade:", error);
      // showUnsuccessModal(error.message);
    }
  };

  return (
    <div className="new-trade">
      <div className="header-card" onClick={toggleModal}>
        <p>New</p>
        <i className="fa-solid fa-plus" id="new-btn"></i>
      </div>

      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setShowModal(false)}>
              ×
            </span>
            <div className="card">
              <h1>New Trade</h1>
            </div>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
                required
              />
              <label htmlFor="optionType">Option Type:</label>
              <input
                type="text"
                name="option_type"
                value={formData.option_type}
                onChange={handleChange}
                required
              />
              <label htmlFor="strikePrice">Strike Price:</label>
              <input
                type="text"
                name="strike_price"
                value={formData.strike_price}
                onChange={handleChange}
                required
              />
              <label htmlFor="expirationDate">Expiration Date:</label>
              <input
                type="date"
                name="expiration_date"
                value={formData.expiration_date}
                onChange={handleChange}
                required
              />
              <label htmlFor="entryPrice">Entry Price:</label>
              <input
                type="text"
                name="entry_price"
                value={formData.entry_price}
                onChange={handleChange}
                required
              />
              <label htmlFor="exitPrice">Exit Price:</label>
              <input
                type="text"
                name="exit_price"
                value={formData.exit_price}
                onChange={handleChange}
              />
              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={formData.contracts}
                onChange={handleChange}
                required
              />
              <label htmlFor="openDate">Open Date:</label>
              <input
                type="date"
                name="open_date"
                value={formData.open_date}
                onChange={handleChange}
                required
              />
              <label htmlFor="closeDate">Close Date:</label>
              <input
                type="date"
                name="close_date"
                value={formData.close_date}
                onChange={handleChange}
              />
              <label htmlFor="profitLoss">Profit Loss:</label>
              <input
                type="text"
                name="profit_loss"
                value={formData.profit_loss}
                onChange={handleChange}
              />
              <input type="submit" value="Add" />
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default NewTrade;
